import pygame
import random
import numpy as np
import sys
import base64
from PIL import Image
from io import BytesIO
import time

# Define the map parameters and initialize pygame
H = np.array([[1, 1], [3, 1], [3, 2], [0, 3]])
G = np.array([3, 3])
MAP = [
    "S", "F", "F", "F",
    "F", "H", "F", "H",
    "F", "F", "F", "H",
    "H", "F", "F", "G"
]

# Colors
WHITE = (255, 255, 255)
BLACK = (0, 0, 0)
GRAY = (169, 169, 169)

# Dimensions
TILE_SIZE = 100
GRID_SIZE = 4

class Game:
    def __init__(self, is_slippery, max_step, render, skin, game_mode):
        assert is_slippery == 0 or is_slippery == 1, "Error: is_slippery values should fall within the interval [0, 1]."
        self.is_slippery = is_slippery
        self.action_space_size = 4
        self.max_step = max_step
        self.render = render
        self.skin = skin
        self.action = None
        self.game_mode = game_mode
        if render == 1:
            self.win = False
            self.lose = False
            skin_width = 60
            skin_height = 50
            self.skin_width = skin_width
            self.skin_height = skin_height
            if skin == "Billy":
                base64_image = b''
            elif self.skin == "Henry":
                base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            r_image = Image.open(image_data)
            r_image = r_image.resize((skin_width, skin_height))
            self.r_image = pygame.image.fromstring(r_image.tobytes(), r_image.size, r_image.mode)
            if skin == "Billy":
                base64_image = b''
            elif self.skin == "Henry":
                base64_image = b'' 
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            l_image = Image.open(image_data)
            l_image = l_image.resize((skin_width, skin_height))
            self.l_image = pygame.image.fromstring(l_image.tobytes(), l_image.size, l_image.mode)
            if skin == "Billy":
                base64_image = b''
            elif self.skin == "Henry":
                base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            f_image = Image.open(image_data)
            f_image = f_image.resize((skin_width, skin_height))
            self.f_image = pygame.image.fromstring(f_image.tobytes(), f_image.size, f_image.mode)
            if skin == "Billy":
                base64_image = b''
            elif self.skin == "Henry":
                base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            b_image = Image.open(image_data)
            b_image = b_image.resize((skin_width, skin_height))
            self.b_image = pygame.image.fromstring(b_image.tobytes(), b_image.size, b_image.mode)
            
            base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            snow_image = Image.open(image_data)
            snow_image = snow_image.resize((TILE_SIZE, TILE_SIZE))
            self.snow_image = pygame.image.fromstring(snow_image.tobytes(), snow_image.size, snow_image.mode)
            base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            hole_image = Image.open(image_data)
            hole_image = hole_image.resize((TILE_SIZE - 20, TILE_SIZE - 20))
            self.hole_image = pygame.image.fromstring(hole_image.tobytes(), hole_image.size, hole_image.mode)
            base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            goal_image = Image.open(image_data)
            goal_image = goal_image.resize((TILE_SIZE - 20, TILE_SIZE - 20))
            self.goal_image = pygame.image.fromstring(goal_image.tobytes(), goal_image.size, goal_image.mode)

        if self.render:
            pygame.init()
            self.screen = pygame.display.set_mode((TILE_SIZE * GRID_SIZE, TILE_SIZE * GRID_SIZE))
            pygame.display.set_caption('Grid World Game')
            self.font = pygame.font.Font(None, 36)
        self.reset()
        if self.game_mode == "human":
            self.main()

    def reset(self):
        self.step_count = 0
        self.state = np.array([0, 0])
        self.reward = 0
        self.done = False
        return self.get_state()

    def step(self, action):
        assert 0 <= action <= self.action_space_size - 1, f"Error: Action values should fall within the interval [0, {self.action_space_size - 1}]."
        if self.render == 0:
            assert self.done == False, "The game has ended."
        self.step_count += 1
        self.action = random.randrange(action - self.is_slippery,
                                       action + self.is_slippery + 1, 1)
        old_state = self.state.copy()
        if self.action == 0 or self.action == 4:
            self.state[0] += 1
        elif self.action == 1:
            self.state[1] += 1
        elif self.action == 2:
            self.state[0] -= 1
        elif self.action == 3 or self.action == -1:
            self.state[1] -= 1
        if (self.state > np.array([3, 3])).any() or (self.state < np.array([0, 0])).any():
            self.state = old_state
        if (self.state == G).all():
            self.reward = 1
            self.done = True
        for i in range(4):
            if (self.state == H[i]).all():
                self.reward = 0
                self.done = True
        if self.step_count > self.max_step:
            self.reward = 0
            self.done = True
        if self.render == 1:
            if self.done:
                if self.reward == 1:
                    self.win = True
                else:
                    self.lose = True
        return self.get_state(), self.done, self.reward

    def get_state(self):
        state = np.zeros(16)
        state[4 * self.state[1] + self.state[0]] = 1
        return state

    def action_space(self):
        return np.arange(self.action_space_size)

    def sample_action(self):
        return np.random.choice(self.action_space(), 1).item()

    def show_map(self):
        MAP = [
            "F", "F", "F", "F",
            "F", "H", "F", "H",
            "F", "F", "F", "H",
            "H", "F", "F", "G"
        ]
        MAP[self.state[0] + self.state[1] * 4] = "\033[30m\033[42mP\033[0m"
        map = ""
        for i in range(0, len(MAP), 4):
            map += " ".join(MAP[i:i + 4]) + "\n"
        return map

    def draw_grid(self):
        if self.win or self.lose:
            for y in range(GRID_SIZE):
                for x in range(GRID_SIZE):
                    self.screen.blit(self.snow_image, (x * TILE_SIZE, y * TILE_SIZE))
            if self.skin == "Billy":
                skin_width = 120
                skin_height = 100
                base64_image = b''
            elif self.skin == "Henry":
                skin_width = 100
                skin_height = 100
                base64_image = b''
            base64_data = base64.b64decode(base64_image)
            image_data = BytesIO(base64_data)
            r_image = Image.open(image_data)
            r_image = r_image.resize((skin_width, skin_height))
            self.r_image = pygame.image.fromstring(r_image.tobytes(), r_image.size, r_image.mode)
            self.screen.blit(self.r_image, (10, 250))
            if self.win:
                font = pygame.font.Font(None, 60)
                frame_text = font.render("You Win!", True, (0, 0, 0))
                self.screen.blit(frame_text, (10, 35))
                font = pygame.font.Font(None, 40)
                frame_text = font.render("Good Job!", True, (0, 0, 0))
                self.screen.blit(frame_text, (100, 230))
            else:
                font = pygame.font.Font(None, 60)
                frame_text = font.render("You Lose...", True, (0, 0, 0))
                self.screen.blit(frame_text, (10, 35))
                font = pygame.font.Font(None, 40)
                frame_text = font.render("Try Harder!", True, (0, 0, 0))
                self.screen.blit(frame_text, (100, 230))
            if self.game_mode == "ai":
                time.sleep(3)
                pygame.quit()
                sys.exit()
        else:
            for y in range(GRID_SIZE):
                for x in range(GRID_SIZE):
                    rect = pygame.Rect(x * TILE_SIZE, y * TILE_SIZE, TILE_SIZE, TILE_SIZE)
                    if [x, y] == G.tolist():
                        type = "goal"
                    elif any((x == h[0] and y == h[1]) for h in H):
                        type = "hole"
                    elif [x, y] == self.state.tolist():
                        type = "person"
                    else:
                        type = "snow"
                    self.screen.blit(self.snow_image, (x * TILE_SIZE, y * TILE_SIZE))
                    pygame.draw.rect(self.screen, GRAY, rect, 1)
                    if type == "person":
                        if self.action == 0:
                            self.screen.blit(self.r_image, (x * TILE_SIZE + 20, y * TILE_SIZE + 25))
                        if self.action == 1:
                            self.screen.blit(self.f_image, (x * TILE_SIZE + 20, y * TILE_SIZE + 25))
                        if self.action == 2:
                            self.screen.blit(self.l_image, (x * TILE_SIZE + 20, y * TILE_SIZE + 25))
                        if self.action == 3:
                            self.screen.blit(self.b_image, (x * TILE_SIZE + 20, y * TILE_SIZE + 25))
                        if self.action == None:
                            self.screen.blit(self.r_image, (x * TILE_SIZE + 20, y * TILE_SIZE + 25))
                    if type == "hole":
                        self.screen.blit(self.hole_image, (x * TILE_SIZE + 10, y * TILE_SIZE + 10))
                    if type == "goal":
                        self.screen.blit(self.goal_image, (x * TILE_SIZE + 10, y * TILE_SIZE + 10))


        

    def main(self):
        running = True
        while running:
            for event in pygame.event.get():
                if event.type == pygame.QUIT:
                    running = False
                elif event.type == pygame.KEYDOWN:
                    if event.key == pygame.K_UP:
                        self.step(3)
                    elif event.key == pygame.K_DOWN:
                        self.step(1)
                    elif event.key == pygame.K_LEFT:
                        self.step(2)
                    elif event.key == pygame.K_RIGHT:
                        self.step(0)
            
            if self.render:
                self.screen.fill(WHITE)
                self.draw_grid()
                pygame.display.flip()

        

game = Game(is_slippery=0, render=1, max_step=50, game_mode="human", skin="Billy")

